    riskValue = text.trim();
    cy.get(threatListViewSelector.threatListViewImpactButton).eq(0).invoke('text').then(text => {
      Rating = text.trim();
      cy.get(threatListViewSelector.threatListViewImpactButton).eq(0).click();
